import React from 'react';
import { Header, Icon, Segment, Grid, Embed } from 'semantic-ui-react';
import Vikings from '../Video/Vikings.mp4';
import Got from '../Video/got.mp4';
import ReactPlayer from 'react-player'


const HeaderPart = () => {
    return (
        <React.Fragment>
            <Grid columns="equal" inverted>
                <Grid.Row textAlign='center'>
                    <Grid.Column>
                        <Segment color='red' inverted>
                            <ReactPlayer url='https://www.youtube.com/watch?v=3PK2tIyENVA'
                                playing
                                loop
                                width='100%'
                            />
                        </Segment>
                    </Grid.Column>
                </Grid.Row>
            </Grid>
        </React.Fragment>
    )
}

export default HeaderPart;
